import React from "react";
import img1 from "./Images/peddyface.png";
import styled from "styled-components";

const Container = styled.div`
    display: flex;
    width: 100px;
    height: 500px;
    justify-conter: center;
    align-items: center;
    background: #027ACB;
    border-radius: 50%;
`;

const StyledImg = styled.img`
    width: 200px;
    height: auto;
`;


const Glassprof = () => {
    return (
        <Container>
            <StyledImg src={img1} />
            <h1>Pedraam Nikzad</h1>
            <h3>CS + Bio @ UC Berkeley</h3>
        </Container>
    )
}

export default Glassprof;
